import React from 'react';
import './Footer.css';


export default function Footer() {
  return (
    <div className='container'>
        <div className='box'>Merinoo</div>
        <div className='box'>
          <p1>La constante de Proponer</p1>
        </div>
        <div className='box'>Miembro Activo del Salón de la Plástica Mexicana </div>
    </div>
  );
}
